import math
M = [[0, 300, 500, 600, 700, 1350, 1650], [6, 0, 350, 450, 600, 1150, 1500], [13, 7, 0, 250, 400, 1000, 1350], [18, 12, 5, 0, 250, 850, 1300], [23, 17, 10, 5, 0, 600, 1150], [43, 37, 30, 25, 20, 0, 500], [58, 52, 45, 40, 35, 15, 0]]

def intime(t):
    return 1730 < t <= 1930

def getinfo(src, dst):
    if src > dst:
        (src, dst) = (dst, src)
    return (M[dst][src], M[src][dst])

def calculate_toll(departure_ic, departure_time, arrival_ic, arrival_time):
    t1 = 100 * departure_time[0] + departure_time[1]
    t2 = 100 * arrival_time[0] + arrival_time[1]
    (a, b) = getinfo(departure_ic - 1, arrival_ic - 1)
    if (intime(t1) or intime(t2)) and a <= 40:
        b = (b // 2 + 49) // 50 * 50
    return b

